Leading Intelligent Banking Solution Provider</span></strong></span></p><p style="text-align: center;"><img title="1587880668108022.jpg" alt="800.jpg" src="http://en.cashwaytech.com/public/ueditor/upload/image/20200426/1587880668108022.jpg"/></p><p style="text-align: justify; text-indent: 2em;" dir="ltr"><span style="font-size: 18px;"><strong><br/></strong></span></p><p style="text-align: left;"><span style="font-size: 18px;"></span></p><p style="text-align: left; text-indent: 2em;"><span style="font-size: 18px;">Cashway Fintech Co.,Ltd. was founded in Tianjin,China in 2004. As a financial technology enterprise,as well as a high-tech,software enterprise listed in the Shanghai Stock Exchange Market in 2017.CASHWAY is dedicated to offering financial electronic products and solutions,integrated with the R&amp;D, manufacturing, marketing, opera-tion, monitoring and relevant outsourcing services of banking self-service equipments.</span></p><p style="text-align: left; text-indent: 2em;"><span style="font-size: 18px;">&nbsp;</span></p><p style="text-align: left; text-indent: 2em;"><span style="font-size: 18px;">As a leading intelligent banking solution provider in China,CASHWAY is committed to providing a full range of smart products,technologies and services such as cash related products,non-cash related products,and payment security<span style="font-size: 18px;"><span style="font-size: 18px;">&nbsp;system required by traditional banks in their transformation to intelligent banks.By the integrated operation mode&amp;ldquo;smart product,advanced technology,and high-quality service&amp;rdquo;,CASHWAY strives to meet various customized needs during the construction and operation of intelligent banks,to effectively reduce operating costs and improve customers&amp;rsquo;experience and services quality;to expand business channels and improve operating efficiency.</span></span></span></p><p style="text-align: left; text-indent: 2em;"><span style="font-size: 18px;">&nbsp;</span></p><p style="text-align: left; text-indent: 2em;"><span style="font-size: 18px;">CASHWAY is China&amp;rsquo;s largest financial self-service equipment provider and the second largest ATM provider in the Domestic brands.It has the only national ATM R&amp;D industrialization base approved by the National Development &amp; Reform Commission.In possession of a number of technical centers,they are &quot;Academician Expert Workstation&quot;,&quot;Postdoctoral scientific research workstation&amp;rdquo;,&amp;ldquo;Financial Equipment Engineering Center&amp;rdquo;and&amp;ldquo;Enterprise Technology Center.It becomes a Member of Board of ATM Industry Association (ATMIA),key member of the CEN/XFS Committee,and one of the key participants in the National Standard Workgroup for China&amp;rsquo;s financial self-service equipment specifications.CASHWAY&amp;rsquo;s each product is tested and qualified in the process of production,passing all the relevant certificates,like ROSH,CE,FCC.</span></p><p style="text-align: left; text-indent: 2em;"><span style="font-size: 18px;">&nbsp;</span></p><p style="text-align: left; text-indent: 2em;"><span style="font-size: 18px;">CASHWAY is keeping its competence of financial service by innovative technology,constantly focusing on its R&amp;D competence with more than 500 professional experts and 4 R&amp;D centers (Beijing,Tianjin,Guangzhou and Chengdu).Through independent innovation,CASHWAY has captured all the core technologies of the currency-related modules that have been monopolized by foreign countries for a long time,mastered all intellectual property rights,and has nearly 1,000 patents and software copyrights.CASHWAY took the lead in promoting the application of the national secret algorithm in the financial industry,and unprecedentedly developed and used domestic operating systems to effectively guarantee the security and controllability for the financial technology support system.</span></p><p style="text-align: left; text-indent: 2em;"><span style="font-size: 18px;">&nbsp;</span></p><p style="text-align: left; text-indent: 2em;"><span style="font-size: 18px;">By now,CASHWAY has provided over 150,000 sets of financial equipments for hundreds of banks and financial institutions.At the same time,CASHWAY obtained certain market share in the Southeast Asia,the Mid-East,Africa and South America,key countries including:&nbsp; Bangladesh, Haiti,Iran, Argentina, Israel, Zambia, Thailand, Pakistan, Brazil, e.g.</span></p><p style="text-align: left; text-indent: 2em;"><span style="font-size: 18px;">&nbsp;</span></p><p style="text-align: left; text-indent: 2em;"><span style="font-size: 18px;">In the future,with its leading advantage in the field of financial self-service technology,CASHWAY is creating more intelligent and self-service scenarios.As the construction of the&amp;ldquo;CASHWAY Cloud platform&amp;rdquo;,CASHWAY,constantly exploring and innovating,provides more smart technology to benefit the public and empower the future.</span></p><p style="text-align: left;">&nbsp;</p>', '0', '1', '1', '', '', '2', 'list_article.htm', 'article_article.htm', 'index_article.htm', '1', '999', '', '69', '383', '0', 'fa-th-list', '');

