INSERT INTO `tp_archives` VALUES ('530', 'Intelligent Cash Recycler - CRM61', '', 'CASHWAY CRM61 recycling is the module of the self-service terminal equipment applied to the ATM or with function of teller cash processing.', '0', '', '', '', '', '', '', '0', '<p><img src="/public/ueditor/upload/image/20200417/1587092148975014.jpg" title="1587092148975014.jpg" alt="CRM61-intelligent cash recycler.jpg" width="984" height="1340" style="width: 984px; height: 1340px;"/></p>', '438', '', '66', '1587092314', '999', '0', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('531', 'Intelligent Cash Recycler - CRM60', '', 'CASHWAY CRM60 recycling module is the core module of the self-service terminal equipment  applied to the ATM or with the function of teller cash processing.', '0', '', '', '', '', '', '', '0', '<p><img src="/public/ueditor/upload/image/20200417/1587092480139500.jpg" title="1587092480139500.jpg" alt="CRM60-intelligent cash recycler.jpg" width="980" height="1480" style="width: 980px; height: 1480px;"/></p>', '438', '', '66', '1587092495', '999', '0', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('532', 'Full Function Card Issuance Machine ', '', 'Full Function Card Issuance Machine supports multi-functions, such as bill double-sided image scanning, bill anti-counterfeiting recognition, bill accepting/selling, card/U-KEY issuance to realize one-stop comprehensive operation for bill business. ', '0', '', '', '', '', '', '', '0', '<p><img src="/public/ueditor/upload/image/20200417/1587093245100350.jpg" title="1587093245100350.jpg" alt="28 交行 制卡版智易通L.jpg"/><img src="/public/ueditor/upload/image/20200417/1587093257949625.jpg" title="1587093257949625.jpg" alt="28 交行 制卡版智易通R.jpg"/></p>', '452', '', '66', '1587093268', '999', '0', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('543', 'Vertical Poster Machine		', '', 'Product poster publicity, instead of the original poster, X display. Publicize bank risk tips, financial fraud information, financial common sense and video publicity through pictures and videos. In the form of flash animation, real-time display of RMB deposit interest rate, exchange rate, gold and other information, the display effect is more gorgeous.
INSERT INTO `tp_archives` VALUES ('544', 'E-Whiteboard		', '', '"The electronic whiteboard integrates the functions of computers, projectors, electronic whiteboards, audio, cameras (optional), high-definition television, advertising machines and other equipment, with the functions of writing, annotation, multi screen interaction, remote video (optional), and integrates the 4K high-definition display, finger touch, human-computer interaction, multimedia information processing, network transmission and other technologies.
INSERT INTO `tp_archives` VALUES ('545', 'Smart Table ', '', '"The intelligent tea table is a multi-functional tea table with intelligent technology as the core technology. It combines the shape of traditional tea table with the touch screen, with various styles available. It can realize human-computer interaction experience without traditional input devices (such as mouse, keyboard, etc.).
INSERT INTO `tp_archives` VALUES ('546', 'Dimming Class', '', 'The thickness of the electric dimming imaging film is only 0.375mm, and the width is 180cm \ 150cm \ 120cm. The laying area can be arbitrarily laid according to the needs of the project size. Due to its light material, it will not have any impact on the original structure when laying. This special type of photoelectric imaging film is compounded on light transparent glass material, which is safe and beautiful, the proportion is 1/3 of that of ordinary glass, very light, safe, and will not burst', '0', '', '', '', '', '', '', '0', '<p><img title="1587097552215804.jpg" alt="演示文稿1.jpg" src="/public/ueditor/upload/image/20200417/1587097552215804.jpg" width="986" height="5214" style="width: 986px; height: 5214px;"/></p>', '457', '', '66', '1587097571', '999', '0', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('547', 'Currency Exchange Machine', '', 'Fashionable & friendly design impresses you with its strong industrializing feeling of shape .Multifunctional cash deposit technology can meet the needs of various forms of deposit business.Support large-capacity high-speed accurate and mixed cash deposits in all denominations of notes, envelop deposit (checks /coins / bills) and foreign currency. It is not only makes you enjoy usual banking self-service but also offers various optional services with prevailing and latest technology.', '0', '', '', '', '', '', '', '0', '<p style="line-height: 1.75em;"><span style="font-family: arial, helvetica,sans-serif; font-size: 16px;">&nbsp;</span></p><table cellspacing="0"><tbody><tr class="firstRow"><td width="936" valign="top" style="padding: 0px 7px; border: 0px rgb(0, 0, 0); border-image: none; -ms-word-break: break-all; background-color: transparent;" colspan="2"><p style="line-height: 1.75em;"><span style="font-family: arial, helvetica,sans-serif; font-size: 24px;"><strong><span style="color: rgb(0, 0, 0); letter-spacing: 0px; font-family: Arial; font-style: normal; font-weight: bold;">Description:</span></strong></span></p><p style="line-height: 1.75em;"><span style="color: rgb(0, 0, 0); letter-spacing: 0px; font-family: arial, helvetica,sans-serif; font-size: 16px; font-style: normal; font-weight: normal;">&nbsp;</span></p><p style="line-height: 1.75em;"><span style="color: rgb(0, 0, 0); letter-spacing: 0px; font-family: arial, helvetica,sans-serif; font-size: 16px; font-style: normal; font-weight: normal;">&nbsp;</span></p><p style="line-height: 1.75em;"><span style="color: rgb(0, 0, 0); letter-spacing: 0px; font-family: arial, helvetica,sans-serif; font-size: 16px; font-style: normal; font-weight: normal;">Fashionable &amp; friendly design impresses you with its strong industrializing feeling of shape .It&nbsp;not&nbsp;only&nbsp;makes you enjoy high volume currency exchange transaction securel