INSERT INTO `tp_archives` VALUES ('538', 'Portable Intelligent Counter', '', 'Portable Intelligent Counter is comprised of all-in-one terminal device, card issuer module, UKEY module, portable rolling suitcase. Under a circumstance of branches or stand by, it conveniently and safely supports multiple self-service functions, such as inquiry, transfer, PIN change, loss card report, signing E-banking, financial management, signing and issuing card on site, accepting bills, payment and other business. For extending branches’ business, enhancing competitiveness, expanding inter-bank business, Portable Intelligent Counter provides effective solutions.', '0', '', '', '', '', '', '', '0', '<p><img title="1587094530804694.jpg" alt="27 工行便携式智能柜员机1.jpg" src="/public/ueditor/upload/image/20200417/1587094530804694.jpg"/></p><p><img title="1587094559494822.jpg" alt="27 工行便携式智能柜员机2.jpg" src="/public/ueditor/upload/image/20200417/1587094559494822.jpg"/></p>', '450', '', '66', '1587095079', '999', '0', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('539', 'Vertical Poster Machine		', '', 'Product poster publicity, instead of the original poster, X display. Publicize bank risk tips, financial fraud information, financial common sense and video publicity through pictures and videos. In the form of flash animation, real-time display of RMB deposit interest rate, exchange rate, gold and other information, the display effect is more gorgeous.
