eposit/withdrawal of banknotes in full denominations; </span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px"><br/></span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Support bulk deposit/withdrawal transactions with multiple transaction media, such as bank card, passbook, unit statement card; </span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px"><br/></span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Support deposit/withdrawal in voice navigation &amp; cash self-bonding, user operation becomes more user-friendly; </span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px"><br/></span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Support face recognition &amp; equipped with dynamic combination lock, effectively protect user’s information safety. </span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p></td><td width="580" valign="top" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p style="text-align:center"><span style="font-family:宋体;font-size:14px"><img src="/public/ueditor/upload/image/20200416/1587019261125975.png" title="1587019261125975.png" alt="1 建行 升级版自助柜员机 (1).png"/></span></p></td></tr><tr><td width="936" valign="top" colspan="2" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 19px"></span></strong></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;padding:0 0 0 0 "><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">Specification:<