style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Finishing the last transaction when power off</span></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Finger Printer</span></strong></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Sensor type: CMOS, matching method: 1:1 or 1:N, interface: USB2.0</span></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Barcode Reader</span></strong></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Support barcode and QR code reading</span></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">ID Card Reader</span></strong></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">ID card reader</span></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Monitor System</span></strong></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Save 3 month, 3 different way record</span></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Camera(Portrait)</span></strong></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Portrait camera</span></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Safe</span></strong></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">CEN L or UL291</span></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Working Environment</span></strong></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Temperature: -30°C to +50°C(-35°C to +50°C, with optional heating unit)</span><span style="font-family: 微软雅黑;letter-spacing: 0;font-size: 16px">.</span></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Relative humidity: 5% - 95%</span><span style="font-family: 微软雅黑;letter-spacing: 0;font-size: 16px">.</span></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Dimensions</span></strong></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">H*W*D: 1500mm * 635mm * 1100mm</span></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Power Supply</span></strong></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">AC220V ± 15%, 50Hz ± 1Hz</span></p><p style="margin: 0px; text-indent: 0px; padding: 0px; line-height: 1.75em;"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">AC110V ± 15%, 60Hz ± 1Hz</span></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0"><br/></p></td></tr></tbody></table><p><span style="font-size: 16px;">* The specific configuration is subject to the actual product</span></p>', '446', '', '66', '1587019453', '999', '0', '1', '', '', '0', '');
