INSERT INTO `tp_archives` VALUES ('463', 'video teller machine', '', 'With advanced internet video technology, the Video Teller Machine (designed for China Merchants Bank) is able to allow customers to do almost of their banking businesses via real-time video interaction and guidance of remote teller, it achieves intelligent transformation from complex counter services to self-service terminal.', '0', '', '', '', '', '', '', '0', '<table data-sort="sortDisabled"><tbody><tr class="firstRow"><td valign="top" rowspan="1" colspan="2" style="word-break: break-all;" width="836"><p style="white-space: normal;" dir="ltr"><span style="font-size: 20px; font-family: " times="" new=""><strong>CASH35AG-1227</strong></span></p><p style="white-space: normal;"><span style="font-family: " times="" new=""><strong><span style="font-family: 微软雅黑;"><br/></span></strong><strong><span style="font-family: 微软雅黑;"></span></strong></span></p><p style="white-space: normal;"><span style="font-family: " times="" new=""><strong><span style="font-family: 微软雅黑;"><br/></span></strong><strong><span style="font-family: 微软雅黑;"></span></strong></span></p><p style="white-space: normal;"><span style="text-indent: 24px; font-size: 16px; font-family: " times="" new="">With advanced internet video technology, the Video Teller Machine (designed for China Merchants Bank) is able to allow customers to do almost of their banking businesses via real-time video interaction and guidance of remote teller, it achieves intelligent transformation from complex counter services to self-service terminal.</span></p></td></tr><tr><td valign="top" style="word-break: break-all;" width="262"><p style="white-space: normal;"><span style="text-indent: 24px; font-family: " times="" new=""><br/></span></p><p style="white-space: normal;"><span style="text-indent: 24px; font-family: " times="" new=""><br/></span></p><p style="white-space: normal;"><span style="text-indent: 24px; font-family: " times="" new=""><br/></span></p><p style