INSERT INTO `tp_archives` VALUES ('462', 'Convenience Retail', '', 'Build an intelligent comprehensive service platform, deploy smart terminals in consumer-intensive areas such as convenience stores, communities, parks, and business districts, provide users with insurance, tourism, finance, ticketing, government, and convenience services, and provide low-cost services for industry enterprises and institutions , High-yield offline customer acquisition and service channels, forming a win-win "information-service-consumption" life economic circle.', '0', '', '', '', '', '', '', '0', '', '386', '', '70', '1586999838', '999', '0', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('540', 'Liquid Crystal Display		', '', 'With the LCD splicing unit, in addition to the optional splicing quantity, the unique internal splicing function and seamless adjustment function can eliminate the dislocation of splicing picture connection caused by the display frame, and meet the needs of different places of use.
INSERT INTO `tp_archives` VALUES ('464', 'Smart Security', '', 'Based on the perception of multi-dimensional heterogeneous data, it can realize information aggregation, data processing, cognitive recognition, etc., and build a video-centric urban safety computing platform to provide intelligent application support capabilities for urban safety management and control.', '0', '', '', '', '', '', '', '0', '', '386', '', '70', '1587000484', '999', '0', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('465', 'Intelligent Life', '', 'The intelligent life platform relies on the storage of cloud computing technology, uses modern science and technology to realize the intelligence of food, clothing, housing, and transportation, and integrates electronic technology into daily work, life, learning and entertainment. Multi-faceted, multi-angle presentation of more comfortable, more convenient, safer and healthier specific scenarios in family life, and then jointly create a smart community with a common smart life concept.', '0', '', '', '', '', '', '', '0', '', '386', '', '70', '1587000575', '999', '0', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('466', 'Intelligent Finance', '', 'With AI, cloud computing, blockchain and other high-tech technologies as core elements, financial institutions are fully empowered, their service efficiency is improved, and the breadth and depth of financial services are expanded, so that the whole society can achieve equality and efficiency , Professional financial services to realize the intelligent, personalized and customized financial services.', '0', '', '', '', '', '', '', '0', '', '386', '', '70', '1587000657', '999', '0', '1', '', '', '0', '');
