INSERT INTO `tp_archives` VALUES ('473', '测试1', '', 'Portable Intelligent Counter is comprised of all-in-one terminal device, card issuer module, U-KEY module, portable rolling suitcase. Under a circumstance of branches or stand by, it conveniently and safely supports multiple self-service functions, such as inquiry, transfer, PIN change, loss card report, signing E-banking, financial management, signing and issuing card on site, accepting bills, payment and other business. For extending branches’ business, enhancing competitiveness, expanding inter-bank business, Portable Intelligent Counter provides effective solutions.', '0', '', '', '', '', '', '', '0', '<table cellspacing="0"><tbody><tr class="firstRow"><td width="936" valign="top" colspan="2" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial;"><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">CASH35AG-1227</span></strong></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0"><span style="font-family: Arial;letter-spacing: 0;font-size: 12px">&nbsp;</span></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0"><span style="font-family: Arial;letter-spacing: 0;font-size: 12px">&nbsp;</span></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">With advanced internet video technology, the Video Teller Machine (designed for China Merchants Bank) is able to allow customers to do almost of their banking businesses via real-time video interaction and guidance of remote teller, it achieves intelligent transformation from complex counter services to self-service terminal.</span></p><p><span style="font-family:Arial;font-size:14px">&nbsp;</span></p></td></tr><tr><td width="356" valign="top" style="padding: 0px 7px; b