INSERT INTO `tp_archives` VALUES ('521', 'Bill Recycler - CASH35AG-1250', '', 'Bill Recycler is designed to support multi-functions, such as bill double-sided image scanning, bill anti-counterfeiting recognition, bill acceptance/selling, issuer of card/UKEY to realize one-stop comprehensive operation for bill business. ', '0', '', '', '', '', '', '', '0', '<table cellspacing="0"><tbody><tr style="height:232px" class="firstRow"><td width="936" valign="top" colspan="2" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial;"><p><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">Description:</span></strong></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style=";font-family:Arial;font-size:16px">Bill Recycler is designed to support multi-functions, such as bill double-sided image scanning, bill anti-counterfeiting recognition, bill acceptance/selling, issuer of card/UKEY to realize one-stop comprehensive operation for bill business. </span></p><p><span style="font-family:Arial;font-size:16px">&nbsp;</span></p></td></tr><tr><td width="356" valign="top" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial;"><p style=";text-indent: 0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">Feature:</span></strong></p><p style=";text-indent: 0"><span style="font-family: Arial;letter-spacing: 0;font-size: 12px">&nbsp;</span></p><p style=";text-indent: 0"><span style="font-family: Arial;letter-spacing: 0;font-size: 12px">&nbsp;</span></p><p><span style=";font-family:Arial;font-size:16px">Support card or passbook transfer certificate to open accounts, transfer/cancel accounts, PIN change, loss card reports;</span></p><p><span style="font-family:Arial;font-size:16px">&nbsp;</span></p><p><span style=";font-family:Arial;font-size:16px">Support cheque clearing and selling;</span></p><p><span style=";font-family:Arial;font-size:16px">Support inquiry, transfer, E-payment of all kinds of cards;</span></p><p><span style="font-family:Arial;font-size:16px">&nbsp;</span></p><p><span style=";font-family:Arial;font-size:16px">The introduction of face recognition and dynamic lock is helpful to effectively protect user’s information safety </span><span style="font-family:微软雅黑;font-size:12px">.</span></p><p style="text-indent:32px;text-autospace:ideograph-numeric"><span style="font-family:Arial;font-size:16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p></td><td width="580" valign="top" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p style="text-align:justify;text-justify:inter-ideograph"><span style=";font-family:宋体;font-size:14px"><img src="/public/ueditor/upload/image/20200416/1587029494261116.png" title="1587029494261116.png" alt="3 农业银行 票据一体机.png"/> </span></p></td></tr><tr><td width="936" valign="top" colspan="2" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">S</span></strong><strong><span style="font-family: 微软雅黑;letter-spacing: 0;font-size: 20px">pecification</span></strong></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0"><span style="font-family: Arial;letter-spacing: 0;font-size: 12px">&nbsp;</span></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Controlling Unit</span></strong></p><p style="mar