6px">Support barcode and QR code reading</span></p><p><strong><span style="font-family: Arial;font-size: 16px">Camera(Portrait)</span></strong></p><p><span style=";font-family:Arial;font-size:16px">Portrait camera</span></p><p><strong><span style="font-family: Arial;font-size: 16px">RFID Card Reader</span></strong></p><p><span style=";font-family:Arial;font-size:16px">Support ISO 14443-4 TYPE A&amp;B</span></p><p><strong><span style="font-family: Arial;font-size: 14px">F</span></strong><strong><span style="font-family: Arial;font-size: 16px">inger Printer</span></strong></p><p><span style=";font-family:Arial;font-size:16px">Sensor type: CMOS, matching method: 1: 1 or 1: N, interface: USB2.0</span></p><p><strong><span style="font-family: Arial;font-size: 16px">Cheque Sell Unit</span></strong></p><p><span style=";font-family:Arial;font-size:16px">Maximum 200 notes per bundle, 6 cassettes, safe: CEN L</span></p><p><strong><span style="font-family: Arial;font-size: 16px">Cheque Sell Unit</span></strong></p><p><span style=";font-family:Arial;font-size:16px">4 cassettes, support charactor &amp; image &amp; QR code printing</span></p><p><strong><span style="font-family: Arial;font-size: 16px">Cheque Processing Unit</span></strong></p><p><span style=";font-family:Arial;font-size:16px">Scan mode: one CIS for two sided scanning, 2 cassettes</span></p><p><strong><span style="font-family: Arial;font-size: 16px">Passbook Printer</span></strong></p><p><span style="font-family: Arial;font-size: 16px">Passbook printer</span></p><p><strong><span style="font-family: Arial;font-size: 16px">A4 Scanner</span></strong></p><p><span style=";font-family:Arial;font-size:16px">Support files<span style="font-family:宋体">、</span><span style="font-family:Arial">document a</span></span><span style=";font-family:Arial;font-size:16px">nd national ID card./passport scanning</span></p><p><strong><span style="font-family: Arial;font-size: 16px">Working Environment</span></strong></p><p><span style=";font-family:Arial;font-size:16px">Temperature: -30°C to +50°C</span></p><p><span style=";font-family:Arial;font-size:16px">Relative humidity: 5% - 95%</span></p><p><strong><span style="font-family: Arial;font-size: 16px">D</span></strong><strong><span style="font-family: Arial;font-size: 16px">imensions</span></strong></p><p><span style=";font-family:Arial;font-size:16px">H*W*D: 1270mm * 880mm * 1040mm</span></p><p><strong><span style="font-family: Arial;font-size: 16px">Power Supply</span></strong></p><p><span style=";font-family:Arial;font-size:16px">AC220V±15% &nbsp;50Hz±1Hz</span></p><p><span style=";font-family:Arial;font-size:16px">AC110V±15% &nbsp;60Hz±1Hz</span></p><p><span style=";font-family:Arial;font-size:16px"><br/></span></p><p><span style=";font-family:Arial;font-size:16px">* The specific configuration is subject to the actual product</span></p><p><span style="font-family:Arial;font-size:14px">&nbsp;</span></p><p><span style="font-family:Arial;font-size:14px">&nbsp;</span></p><p><span style="font-family:Arial;font-size:14px">&nbsp;</span></p><p><br/></p></td></tr></tbody></table><p><br/></p>', '446', '', '66', '1587029574', '999', '0', '0', '', '', '0', '');
