<br/></span></strong></p><p style=";text-indent: 0"><span style="font-family: Arial;letter-spacing: 0;font-size: 12px">&nbsp;</span></p><p style=";text-indent: 0"><span style="font-family: Arial;letter-spacing: 0;font-size: 12px">&nbsp;</span><span style="font-family: Arial; font-size: 16px; text-indent: 32px;">Equipped with self-developed recycling cash module and support high-speed deposit/withdrawal of banknotes in full denominations;</span></p><p style=";text-indent: 0"><span style="font-family: Arial; font-size: 16px; text-indent: 32px;"><br/></span></p><p style=";text-indent: 0"><span style="font-family: Arial; font-size: 16px; text-indent: 32px;">Support multiple bill business(e.g. both public and personal) processing &amp; cheque selling;</span></p><p style=";text-indent: 0"><span style="font-family: Arial; font-size: 16px; text-indent: 32px;"><br/></span></p><p style=";text-indent: 0"><span style="font-family: Arial; font-size: 16px; text-indent: 32px;">Support deposit of worn bills and coins, with anti-theft function by safe shutter;</span></p><p style=";text-indent: 0"><span style="font-family: Arial; font-size: 16px; text-indent: 32px;"><br/></span></p><p style=";text-indent: 0"><span style="font-family: Arial; font-size: 16px; text-indent: 32px;">The introduction of face recognition and dynamic lock is helpful to effectively protect user’s information safety.</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p></td><td width="580" valign="top" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p style="text-align:justify;text-justify:inter-ideograph"><span style="font-family:宋体;font-size:14px">&nbsp;<img src="/public/ueditor/upload/image/20200416/1587024818263698.png" title="1587024818263698.png" alt="2 农业银行 票据现金一体机.PNG" width="446" height="618" style="width: 