eight: 1.75em;"><strong><span style="font-family: Arial;font-size: 16px">Cheque Sell Unit</span></strong></p><p style="line-height: 1.75em;"><span style=";font-family:Arial;font-size:16px">4 cassettes, support charactor &amp; image &amp; QR code printing</span></p><p style="line-height: 1.75em;"><strong><span style="font-family: Arial;font-size: 16px">Cheque Processing Unit</span></strong></p><p style="line-height: 1.75em;"><span style=";font-family:Arial;font-size:16px">Scan mode: one CIS for two sided scanning, 2 cassettes</span></p><p style="line-height: 1.75em;"><strong><span style="font-family: Arial;font-size: 16px">A4 Scanner</span></strong></p><p style="line-height: 1.75em;"><span style=";font-family:Arial;font-size:16px">Support files</span><span style="font-size: 16px;"><span style="font-family:宋体">,</span></span><span style="font-size: 16px;"><span style="font-family: Arial;">document a</span></span><span style=";font-family:Arial;font-size:16px">nd national ID card./passport scanning</span></p><p style="line-height: 1.75em;"><strong><span style="font-family: Arial;font-size: 16px">Working Environment</span></strong></p><p style="line-height: 1.75em;"><span style=";font-family:Arial;font-size:16px">Temperature: -30°C to +50°C</span></p><p style="line-height: 1.75em;"><span style=";font-family:Arial;font-size:16px">Relative humidity: 5% - 95%</span></p><p style="line-height: 1.75em;"><strong><span style="font-family: Arial;font-size: 16px">D</span></strong><strong><span style="font-family: Arial;font-size: 16px">imensions</span></strong></p><p style="line-height: 1.75em;"><span style=";font-family:Arial;font-size:16px">H*W*D: 1270mm * 880mm * 1040mm</span></p><p style="line-height: 1.75em;"><strong><span style="font-family: Arial;font-size: 16px">Power Supply</span></strong></p><p style="line-height: 1.75em;"><span style=";font-family:Arial;font-size:16px">AC220V±15% &nbsp;50Hz±1Hz</span></p><p style="line-height: 1.75em;"><span style=";font-family:Arial;f