INSERT INTO `tp_archives` VALUES ('497', 'Intelligent Cash Recycler - CASH80ALC', '', 'Intelligent Cash Recycler integrates the functions of bulk cash processing by card or passbook, personal or public bill processing and coin exchange. It can effectively enhance the usage frequency and reliability to deal with business and also provide more service scenarios to users in the branch. ', '0', '', '', '', '', '', '', '0', '<p><br/></p><table cellspacing="0"><tbody><tr class="firstRow"><td width="936" valign="top" colspan="2" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">Description:</span></strong></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Intelligent Cash Recycler integrates the functions of bulk cash processing by card or passbook, personal or public&nbsp; bill&nbsp; processing&nbsp; and&nbsp;&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">coin&nbsp; exchange. It can effectively enhance the usage frequency and reliability to deal with business&nbsp; and&nbsp; also&nbsp; provide&nbsp; more&nbsp; service&nbsp;&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">scenarios&nbsp; to users in the branch. </span></p></td></tr><tr><td width="356" valign="top" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p style=";text-indent: 0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px"><br/></span></strong></p><p style=";text-indent: 0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px"><br/></span></strong></p><p style=";text-indent: 0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">Feature:</span></strong><br/></p><p style=";text-indent: 0"><span style="font-family: Arial;letter-spacing: 0;font-size: 12px">&nbsp;</span></p><p style=";text-indent: 0"><span style="font-family: Arial;letter-spacing: 0;font-size: 12px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Equipped&nbsp; &nbsp;with&nbsp; self-developed&nbsp; &nbsp;high&nbsp; speed&nbsp; cash recycling module, support high-speed deposit/withdrawal of banknotes in full denominations; </span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Integrated with cash processing business by card &amp; passbook and bill processing businesses;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Equipped with coin recycling module, provide coin exchange services;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p dir="ltr"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">It is suitable for the lobby and through-the-wall installation in the branch, meeting the requirements of industry security.</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p></td><td width="580" valign="top" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p><span style="font-family:宋体;font-size:14px"><img src="/public/ueditor/upload/image/20200416/1587022856163778.png" title="1587022856163778.png" alt="5 中原银行 现金智能柜台 .png"/></span></p></td></tr><tr><td width="936" valign="top" colspan="2" style="padding: 0px 7px; border-width: initial; border-sty