argin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Binocular camera, Panoramic camera, Shutter camera</span></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Cash Recycler + Shutter</span></strong></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Maximum 200 notes per bundle</span><span style="font-family: 微软雅黑;letter-spacing: 0;font-size: 16px">.</span></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Working Environment</span></strong></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Temperature: -30°C to +50°C</span></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Relative humidity: 5% - 95%</span></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Dimensions</span></strong></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">H*W*D: 1480mm * 765mm * 1005mm</span></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Power Supply</span></strong></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">AC220V ± 15% 50Hz ± 1Hz</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">AC110V ± 15% 60Hz ± 1Hz</span></p></td></tr></tbody></table><p><br/></p><p><span style="font-size: 16px;">* The specific configuration is subject to the actual product</span></p>', '446', '', '66', '1587022924', '999', '0', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('498', 'Intelligent Transportation', '', 'Accounting for about 80% of the market scale of the whole intelligent parking lot management system, through video license plate recognition, etc, RFID remote recognition, Bluetooth remote recognition, etc., the intelligent management of the entrance and exit is realized.
INSERT INTO `tp_archives` VALUES ('499', 'Intelligent Medica', '', ' Through the implementation of the self-service system, as well as the self-service terminals with different functions deployed in hospitals, patients can make medical card, top up, registration, payment, printing report/ invoice/medical history, medicare guiding service by themselves. Thus completing patients bypass, reducing window working pressure and patients’ waiting time, improving patients’ medical experience. System functions can be customized as hospital’s requirements.
INSERT INTO `tp_archives` VALUES ('494', 'Smart Teller Machine - CASH35AG-1201', '', 'CASHWAY’s Smart Teller Machine integrates the advantages of traditional Card Issuing Machine, Receipt Printing Machine, KIOSK and Ticket Vending Machine. It covers most of the private and public non-cash businesses, which plays an important role for branch intelligent transformation and business process optimization.', '0', '', '', '', '', '', '', '0', '<p><br/></p><table cellspacing="0" cellpadding="0"><tbody><tr class="firstRow"><td width="936" colspan="2" valign="top" style="padding: 0px 7px;"><p style=";font-size: 14px;font-family: Calibri, sans-serif;text-align: justify"><strong><span style="font-size: 20px;font-family: Arial, sans-serif">Description:</span></strong></p><p style=";font-size: 14px;font-family: Calibri, sans-serif;text-align: justify"><span style="font-size: 16px;font-family: Arial, sans-serif">&nbsp;</span></p><p style=";font-size: 14px;font-family: Calibri, sans-serif;text-align: justify"><span style="font-size: 16px;font-family: Arial, sans-serif">&nbsp;</span></p><p style=";font-size: 14px;font-family: Calibri, sans-serif;text-align: justify"><span style="font-size: 16px;font-family: Arial, sans-serif">CASHWAY’s Smart Teller Machine integrates the advantages of traditional Card Issuing Machine, Receipt Printing Machine, KIOSK and Ticket Vending Machine. It covers most of the private and public non-cash businesses, which plays an important role for branch intelligent transformation and business process optimization.</span></p><p style=";font-size: 14px;font-family: Calibri, sans-serif;text-align: justify"><span style="font-size: 16px;font-family: Arial, sans-serif">&nbsp;</span></p><p style=";font-size: 14px;font-family: Calibri, sans-serif;text-align: justify"><span style="font-size: 16px;font-family: Arial, sans-serif">&nbsp;</span></p></td></tr><tr><td width="356" valign="top" style="padding: 0px 7px; word-break: break-all;"><p style="margin-right: 0;margi