INSERT INTO `tp_archives` VALUES ('503', 'Compact Cash Recycler - CASH80AWG-41', '', 'Compact cash recycler by CASHWAY is dedicated to the “Three Agricultures” markets (agriculture, rural areas and farmers), aims to provide cash deposit/ withdrawal services in small amount. It is a perfect lobby solution for financial retailing stores, supermarkets and mini-branches. This machine is able to meet the policy requirements of serving “three agricultures” and providing inclusive finance services. ', '0', '', '', '', '', '', '', '0', '<p><br/></p><table cellspacing="0"><tbody><tr class="firstRow"><td width="936" valign="top" colspan="2" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">Description:</span></strong></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Compact cash recycler by CASHWAY is dedicated to the “Three Agricultures” markets (agriculture, rural areas and farmers), aims to</span></p><p><span style="font-family: Arial; font-size: 16px; letter-spacing: 0px;">provide cash deposit/ withdrawal services in small amount. It is a perfect lobby solution for financial retailing stores, supermarkets and</span></p><p><span style="font-family: Arial; font-size: 16px; letter-spacing: 0px;">mini&nbsp;</span><span style="font-family: Arial; font-size: 16px; letter-spacing: 0px;">branches. This machine is able to meet the policy requirements of serving “three agricultures” and providing inclusive finance&nbsp;</span></p><p><span style="font-family: Arial; font-size: 16px; letter-spacing: 0px;">services.</span></p></td></tr><tr><td width="356" valign="top" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: i