INSERT INTO `tp_archives` VALUES ('513', 'Voice Recognition Solution', '', 'This system can open the corresponding function menu of the device through voice command. Based on the embedded off-line recognition engine, zero traffic real-time response, to achieve fast and stable localization of voice services.
INSERT INTO `tp_archives` VALUES ('514', 'Intelligent Cash Recycler - CASH80ALU', '', 'With independent R&D cash recycling module, CASHWAY’s intelligent cash recycler is characterized by large capacity’s design on both cash slot and notes cassette. Capable of remote self-sorting & cash replenishing, its performance has become a flagship in cash recycling module of independent R&D brand.', '0', '', '', '', '', '', '', '0', '<p><br/></p><table cellspacing="0"><tbody><tr class="firstRow"><td width="936" valign="top" colspan="2" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">Description:</span></strong></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">With independent R&amp;D cash recycling module, CASHWAY’s intelligent cash recycler is characterized by large capacity’s design on&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">both cash slot and notes cassette.Capable of remote self-sorting &amp; cash replenishing, its performance has become a flagship in cash&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">recycling module of independent R&amp;D brand.</span></p></td></tr><tr><td width="356" valign="top" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p style=";text-indent: 0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px"><br/></span></strong></p><p style=";text-indent: 0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px"><br/></span></strong></p><p style=";text-indent: 0"><strong><span style="font-family: Arial;letter-spacing: 0;font-si