INSERT INTO `tp_archives` VALUES ('511', 'Intelligent Queuing System', '', 'The smart queuing system is divided into two parts: the number picking system and the background management system, which realizes the unified management of the high teller, low teller, self-service equipment and smart teller machines at the bank outlets. Guide and divert customers based on their different business needs.
INSERT INTO `tp_archives` VALUES ('512', 'VIP Face Recognition Solution', '', 'How to identify the VIP customers of the bank in the first time and provide them with more intimate services is the key to marketing VIP customers and improving the service quality of the bank.
INSERT INTO `tp_archives` VALUES ('517', 'Intelligent Cash Recycler - CASH80AWU', '', 'With independent R&D cash recycling module, CASHWAY’s intelligent cash recycler is characterized by large capacity’s design on both cash slot and notes cassette. Capable of remote self-sorting & cash replenishing, its performance has become a flagship in cash recycling module of independent R&D brand. ', '0', '', '', '', '', '', '', '0', '<p><br/></p><table cellspacing="0"><tbody><tr class="firstRow"><td width="936" valign="top" colspan="2" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">Description:</span></strong></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">With independent R&amp;D cash recycling module, CASHWAY’s intelligent cash recycler is characterized by large capacity’s design on both cash slot and notes cassette. Capable of remote self-sorting &amp; cash replenishing, its performance has become a flagship in cash recycling module of independent R&amp;D brand.</span></p></td></tr><tr><td width="356" valign="top" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p style=";text-indent: 0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px"><br/></span></strong></p><p style=";text-indent: 0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px"><br/></span></strong></p><p style=";text-indent: 0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">Feature:</span></strong></p><p style=";text-indent: 0"><span style="font-family: Arial;letter-spacing: 0;font-size: 12px">&nbsp;</span></p><p style=";text-inden