INSERT INTO `tp_archives` VALUES ('518', 'OCR Cloud Platform', '', 'OCR is an optical character recognition technology that recognizes a variety of materials including text, images, and documents. OCR technology is widely used, saying goodbye to the past when many types of data required manual entry and manual recognition, which saved a lot of labor / time costs.
INSERT INTO `tp_archives` VALUES ('519', 'Smart Locker  CASH35AG-1239', '', 'Under the background of branch transformation and convenience, the smart locker aims at reforming branch operation and management. The introduction of“smart locker” in branch can realize the centralized storage and management of operation elements, such as branch receipts and important items with the method of centralization & sharing.', '0', '', '', '', '', '', '', '0', '<table cellspacing="0" cellpadding="0" style=""><tbody><tr style=";height:232px" class="firstRow"><td width="936" colspan="2" valign="top" style="padding: 0px 7px; word-break: break-all;" height="232"><p><strong><span style="font-size:20px;font-family:   &#39;Arial&#39;,&#39;sans-serif&#39;;color:black">Description:</span></strong></p><p><span style="font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:black">&nbsp;</span></p><p><span style="font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:black">&nbsp;</span></p><p><span style="font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;">Under the background of branch transformation &nbsp; and convenience, the smart locker aims at reforming branch operation and management. &nbsp; The introduction of “smart locker” in branch can realize the centralized &nbsp; storage and management of operation elements, such as branch receipts and &nbsp; important items with the method of centralization &amp; sharing.</span></p></td></tr><tr><td width="433" valign="top" style="padding: 0px 7px; word-break: break-all;"><p><strong><span style="font-size:   20px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:black">Feature:</span></strong></p><p><span style="font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:black">&nbsp;</span></p><p><span style="font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:black">&nbsp;</span></p><p><span style="font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:black">Replacing the traditional way of &nbsp; physical handover, it breaks the bottleneck between person and physical &nbsp; objects<span style="font-family: Arial, sans-serif; font-size: 16px;">.</span></span></p><p><span style="font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:black">&nbsp;</span></p><p><span style="font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:black">The smart locker adopts cold &nbsp; rolling steel plate technology, which is healthy, safe and environmental &nbsp; protection<span style="font-family: Arial, sans-serif; font-size: 16px;">.</span></span></p><p><span style="font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:black">&nbsp;</span></p><p><span style="font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:black">Each lock of the cabinet door is &nbsp; controlled by the system, different locks with anti-theft design do not &nbsp; interfere with each other<span style="font-family: Arial, sans-serif; font-size: 16px;">.</span> </span></p><p><span style="font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:black">&nbsp;</span></p><p><span style="font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:black">It is suitable for the lobby and &nbsp; through-the-wall installation in the branch, meeting the requirements of &nbsp; industry security.</span></p><p><span style="font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:black">&nbsp;</span></p></td><td width="573" valign="top" style="padding: 0px 7px; word-break: break-all;"><p><img src="/public/ueditor/upload/image/20200416/1587029249552743.png" title="1587029249552743.png" alt="11 智能储物柜 (1).png" style="float: right;"/></p></td></tr><tr><td width="936" colspan="2" valign="top" style="padding: 0px 7px; word-break: break-all;"><p><strong><span style="font-size:   20px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:black">Specification</span></strong></p><p><s