INSERT INTO `tp_archives` VALUES ('520', 'POS ATM  - CASH80AWI-33', '', 'With innovative combination of advanced ATM dispensing system and wireless POS payment technology, the POS ATM adopts wireless 4G/5G dedicated communication channel to ensure more secure and reliable data exchange and more convenient deployment in rural branches.', '0', '', '', '', '', '', '', '0', '<p><br/></p><table cellspacing="0"><tbody><tr class="firstRow"><td width="936" valign="top" colspan="2" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">Description:</span></strong></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">With innovative combination of advanced ATM dispensing system and wireless POS payment technology, the POS ATM adopts wireless 4G/5G dedicated communication channel to ensure more secure and reliable data exchange and more convenient deployment in rural branches</span><span style="font-family: 微软雅黑;letter-spacing: 0;font-size: 16px">.</span></p></td></tr><tr><td width="356" valign="top" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p style=";text-indent: 0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px"><br/></span></strong></p><p style=";text-indent: 0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px"><br/></span></strong></p><p style=";text-indent: 0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px"><br/></span></strong></p><p style=";text-indent: 0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">Feature:</span></strong></p><p style=";text-indent: 0"><span style="font-family: Arial;letter-spacing: 0;font-size: 12px">&nbsp;</span></p><p style=";text-indent: 0"><span style="font-family: Arial;letter-spacing: 0;font-size: 12px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Compact appearance design, enables easy deployment in rural branches; </span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Using bank-specific interface for POS settlement to make data exchange become safer and more reliable; </span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Adopting 5G dedicated to communication channel, ensure a faster financial service experience; </span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Through the POS ATM deployment in rural areas and increase the amount of cards issuance and cash deposit to improve the effectiveness of serving agriculture, rural areas and farmers.</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p></td><td width="580" valign="top" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p><span style="font-family:宋体;font-size:14px"><img src="/public/ueditor/upload/image/20200416/1587028002665314.png" title="1587028002665314.png" alt="8 建行 POSATM (1).png"/></span></p></td></tr><tr><td width="936" valign="top" colspan="2" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0"><strong><span style="