: 5 notes/s, 1 cassette, capacity: 1000, 1 reject vault, capacity: 200</span></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Safe</span></strong></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">UL 291</span></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Camera(Shutter)</span></strong></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Camera (Shutter) 130M pixel</span></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Camera(Portrait)</span></strong></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Camera (Portrait) 130M pixel</span></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Power Unit</span></strong></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Support 100-240V ± 15%, 50Hz ± 1%Hz</span></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0;line-height:28px"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">Working Environment</span></strong></p><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text