INSERT INTO `tp_archives` VALUES ('525', 'Cash Recycler Machine (TTW) - Cash 80 AWG', '', 'CRS(TTW) is a multi-function integrated through-the-wall machine, it provides cash deposit and withdrawal configuration mode as below: Cash deposit, Cash withdrawal, Cash deposit and withdrawal(non-recycling), cash recycling deposit and withdrawal. CRS integrated all the functions of Cashway single withdrawal cash machine,besides cash deposit & withdrawal,it also provide transfer, inquiry,password change,multi-media ad.,RFIDcard top-up  and cash deposit/withdrawal functions and it also provide other non-cash services functions include distributing tickets,coupons, lotteries, etc synchronously. ', '0', '', '', '', '', '', '', '0', '<p><br/></p><table cellspacing="0"><tbody><tr class="firstRow"><td width="967" valign="top" style="padding: 0px 7px; word-break: break-all;" colspan="2"><p style="text-align: justify; line-height: 1.75em;"><span style="font-family: arial, helvetica, sans-serif;"><strong><span style="letter-spacing: 0px; font-size: 27px;">Description:</span></strong></span></p><p style="text-align: justify; line-height: 1.75em;"><span style="letter-spacing: 0px; font-family: arial, helvetica, sans-serif; font-size: 21px;">&nbsp;</span></p><p style="text-align: justify; line-height: 1.75em;"><span style="letter-spacing: 0px; font-family: arial, helvetica, sans-serif; font-size: 21px;">&nbsp;</span></p><p style="text-align: justify; line-height: 1.75em;"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;"></span></p><p style="text-align: justify; line-height: 1.75em;"><span style="font-family: arial, helvetica, sans-serif; font-size: 16px;">CRS(TTW) is&nbsp;a&nbsp;multi-function&nbsp;integrated&nbsp;through-the-wall&nbsp;machine,&nbsp;it&nbsp;provides&nbsp;cash&nbsp;deposit&nbsp;and&nbsp;withdrawal&nbsp;configuration&nbsp;mode&nbsp;as&nbsp;below:Cash&nbsp;deposit,&nbsp;Cash&nbsp;withdrawal,&nbsp;Cash&nbsp;deposit&nbsp;and&nbsp;withdrawal(nonrecycli