INSERT INTO `tp_archives` VALUES ('527', 'Cash Recycler - CASH80ALC-003', '', 'Cash Recycler is designed to support large capacity and high-speed cash deposit/withdrawal, non-stop deposit, banknotes mixed deposit in full denominations, cash sorting and small amount cash exchange to realize one-stop comprehensive operation for cash business.', '0', '', '', '', '', '', '', '0', '<table cellspacing="0" width="766"><tbody><tr style="height:232px" class="firstRow"><td width="319" valign="top" colspan="2" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial;"><p><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">Description:</span></strong></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style=";font-family:Arial;font-size:16px">Cash Recycler is designed to support large capacity and high-speed cash deposit/withdrawal, non-stop deposit, banknotes mixed deposit in full denominations, cash sorting and small amount cash exchange to realize one-stop comprehensive operation for cash business.</span></p><p><span style="font-family:Arial;font-size:16px">&nbsp;</span></p><p><span style="font-family:Arial;font-size:16px">&nbsp;</span></p></td></tr><tr><td width="68" valign="top" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial;"><p style=";text-indent: 0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">Feature:</span></strong></p><p style=";text-indent: 0"><span style="font-family: Arial;letter-spacing: 0;font-size: 12px">&nbsp;</span></p><p style=";text-indent: 0"><span style="font-family: Arial;letter-spacing: 0;font-size: 12px">&nbsp;</span></p><p><span style=";font-family:Arial;font-size:16px">Equipped with self-developed recycling cash module and support high-speed deposit/withdrawal of banknotes in full denominations; </span></p><p><span style="font-family:Arial;font-size:16px">&nbsp;</span></p><p><span style=";font-family:Arial;font-size:16px">Support deposit of worn bills &amp; coins, with anti-theft function by safe shutter; </span></p><p><span style="font-family:Arial;font-size:16px">&nbsp;</span></p><p><span style=";font-family:Arial;font-size:16px">The introduction of face-vivo detection and dynamic lock is helpful to effectively protect user’s information safety; </span></p><p><span style="font-family:Arial;font-size:16px">&nbsp;</span></p><p><span style=";font-family:Arial;font-size:16px">It is suitable for the lobby and through-the-wall installation in the branch, meeting the requirements of industry security.</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p><p><span style="font-family: Arial;letter-spacing: 0;font-size: 16px">&nbsp;</span></p></td><td width="250" valign="top" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p style="text-align:justify;text-justify:inter-ideograph"><span style=";font-family:宋体;font-size:14px">&nbsp;&nbsp;</span></p><p style="text-align:center">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src="/public/ueditor/upload/image/20200416/1587030840121702.png" title="1587030840121702.png" alt="4 农业银行 现金一体机.PNG" width="528" height="687" style="width: 528px; height: 687px; float: right;"/></p><p style="text-align:justify;text-justify:inter-ideograph"><span style=";font-family:宋体;font-size:14px"> </span><br/></p></td></tr><tr><td width="319" valign="top" colspan="2" style="padding: 0px 7px; border-width: initial; border-style: none; border-color: initial; word-break: break-all;"><p style="margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:0"><strong><span style="font-family: Arial;letter-spacing: 0;font-size: 20px">S</span></strong><strong><span style="font-family: 微软雅黑