INSERT INTO `tp_archives` VALUES ('693', 'New milestone--- CASHWAY WON THE BID FOR ICBC’S RECYCLER PROJECT', '', 'In March, all things begin to grow. CASHWAY successfully won the bid for ICBC’s deposit & withdrawal recycler project, a breakthrough in the landmark. Up to now, CASHWAY become the only supplier of cash equipment and solutions for five state-owned banks in the industry—ABC, CCB, PSBC, Bank of Communication, ICBC, marking that CAHSWAY has the absolute influence in the field of financial self-service equipment in China and laid the fundament of the industry leader.', '0', '', '', '', '', '', '', '0', '<p style="text-indent: 2em; text-align: justify;"><span style=";font-family:等线;font-size:16px">In March, all things begin to grow. CASHWAY successfully won the bid for ICBC’s deposit &amp; withdrawal recycler project, a breakthrough in the landmark.</span><span style=";font-family:等线;font-size:16px">&nbsp;</span><span style=";font-family:等线;font-size:16px">Up to now, CASHWAY become the only supplier of cash equipment and solutions for five state-owned banks in the industry—ABC, CCB, PSBC, Bank of Communication, ICBC, marking that CAHSWAY has the absolute influence in the field of financial self-service equipment in China and laid the fundament of the industry leader. </span></p><p style="text-indent: 2em; text-align: justify;"><span style=";font-family:等线;font-size:14px">&nbsp;</span></p><p style="text-indent: 2em; text-align: justify;"><span style=";font-family:等线;font-size:16px">C</span><span style=";font-family:等线;font-size:16px">omplete sincerity is to achieve the great goal. As the world’s biggest, the first and most profitable customer deposits in the listed banks, ICBC has the high-quality customer base, diversified business structure, strong innovation ability and market competitiveness. In recent years, ICBC successively won the global best commercial bank, ranking first in the aspects of commercial bank’s core competitiveness, tier one capital and the first of total assets in the world bank, first in the fortune top 500 world banks. Business across six continents, outside the business network extended to 40 countries and regions, ICBC provides 4.735 million public customers and 432 million individual customers a wide range of financial products and services by 17,245 domestic institutes, 329 outside institutes, 1903 agents and online banking, telephone banking and self-service bank and other distribution channels, formed by commercial Banks as the main body, integration, internationalization, informationization management pattern, to maintain the leading position domestic and international market.</span></p><p style="text-indent: 2em; text-align: justify;"><span style=";font-family:等线;font-size:14px">&nbsp;</span></p><p style="text-indent: 2em; text-align: justify;"><span style=";font-family:等线;font-size:14px"></span></p><p style="text-indent: 2em; text-align: justify;"><span style=";font-family:等线;font-size:16px">From excellent to outstanding, science and technology leads the future. CASHWAY is the only a national ATM research and development and industrialization base approved by the National Development and Reform Commission; listed in the &quot;five-year revitalization plan of science and technology project&quot; and &quot;National torch plan project implementation unit&quot; submitted by the Ministry of Science and Technology; the “electronic development fund project implementation unit&quot; approved by MIIT; Tianjin’s &quot;major independent innovation industrialization projects&quot;, &quot;major industrial project implementation unit&quot;, and CASHWAY has </span></p><p style="text-indent: 2em; text-align: justify;"><span style=";font-family:等线;font-size:16px">&quot;post-doctoral scientific research workstation&quot;, &quot;enterprise technology center&quot;, &quot;financial self-service equipment technology engineering center&quot;. CASHWAY successively awarded the honors of &quot;science and technology service industry demonstration enterprise&quot;, &quot;the most growth enterprises&quot;, &quot;keep the contract heavy credit enterprise&quot;, &quot;national May Day labor diploma&quot;, &quot;best employer&quot;, &quot;double strong six good party organization&quot;, </span></p><p style="text-indent: 2em; text-align: justify;"><span style=";font-family:等线;font-size:16px">As a representative of the national excellent brand, CASHWAY focuses on scientific and technological innovation, leads the industry development, firstly becomes a domestic advocate and facilitator of the encryption algorithm, and plays an important role in the localization process, information security, promotion of intelligent bank and beneficial public’s financial development.</span><span style=";font-family:等线;font-size:16px">&nbsp;</span><span style=";font-family:等线;font-size:16px">CASHWAY’s market share is several times in the rapid growth of the industry average growth rate, and in 2014 the total revenues of ATM/CRS is nearly ten thousand units. CASHWAY’s financial equipment are providing safe and convenient service for people.</span></p><p style="text-indent: 2em; text-align: justify;"><span style=";font-family:等线;font-size:14px">&nbsp;</span></p><p style="text-indent: 2em; text-align: justify;"><span style=";font-family:等线;font-size:16px">Dancing with the strong, I will be stronger. From the strategic level, CASHWAY pays great attention on the ICBC’s project, giving full play the core advantage of national independent brand of financial equipment and industry leader; relying on many years of technology accumulation and diversity of the independent innovation ability, advanced and mature multi-functional self-service product line, 24hours*7 days covers all after-sales service system, in strict accordance with the industrial and commercial bank of China self-service business requirements, make the customized cash such equipment and service solutions, obtained the approval of the industrial and commercial bank of China, project successfully won the bid for domestic brands different machine.</span></p><p style="text-indent: 2em; text-align: justify;"><span style=";font-family:等线;font-size:14px">&nbsp;</span></p><p style="text-indent: 2em; text-align: justify;"><span style=";font-family:等线;font-size:16px">The bidding project of ICBC not only promotes the leap-forward development of CASHWAY, also prompts the ATM industry pattern happen big changes. Creating Chinese famous brand, CASHWAY enhances the independent innovation ability, and core competitiveness, enriching the comprehensive value of product and service brand, striving for the development of China&#39;s financial electronic!</span></p><p><br/></p>', '489', '', '77', '1426780800', '150320', '0', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('692', 'CASHWAY supplying cash self-service equipment to ABC for constantly five years ', '', 'Recently, since 2011, CASHWAY successfully won the candidates self-service equipment project of ABC, and for three consecutive years as quality suppliers, once again successfully won the bid for the agricultural bank of China. In 2015, CASHWAY won the bidding of centralized purchasing project (cash self-service equipment). By now, CSHWAY becomes the ABC bank’s cash self-service equipment main suppliers for constantly five years.', '0', '', '', '', '', '', '', '0', '<p style="text-indent: 2em;"><span style=";font-family:等线;font-size:16px">Recently, since 2011, CASHWAY successfully won the candidates self-service equipment project of ABC, and for three consecutive years as quality suppliers, once again successfully won the bid for the agricultural bank of China. In 2015, CASHWAY won the bidding of centralized purchasing project (cash self-service equipment). By now, CSHWAY becomes the ABC bank’s cash self-service equipment main suppliers for constantly five years.</span></p><p style="text-indent: 2em;"><span style=";font-family:等线;font-size:14px">&nbsp;</span></p><p style="text-indent: 2em;"><span style=";font-family:等线;font-size:16px">ABC is the first state-owned commercial Banks since new China was established, an important part of China&#39;s financial system. It has been the world&#39;s top 500 companies, ranking top seven in the &quot;top 1000 global Banks&quot;, and moody&#39;s credit rating of A1. In 2009, the bank&#39;s overall restructuring by the wholly state-owned commercial Banks is considered as the modern joint-stock commercial Banks, in 2010 completed &quot;A + H&quot; dual listing, and its total assets is more than 16 trillion yuan, the market value ranked fifth in the listed bank. Online operation of all kinds of self-service equipment is more than 170000 units, it is the world&#39;s largest self-service channel network.</span></p><p style="text-indent: 2em;"><span style=";font-family:等线;font-size:14px">&nbsp;</span></p><p style="text-align:center"><img src="/public/ueditor/upload/image/20201030/1604042533101197.jpeg" title="1604042533101197.jpeg" alt="5ed4bcd7a310f5a73510cb94.jpeg"/></p><p style="text-indent: 2em;"><span style=";font-family:等线;font-size:14px"></span><br/></p><p style="text-indent: 2em;"><span style=";font-family:等线;font-size:16px">S</span><span style=";font-family:等线;font-size:16px">ince CASHWAY cooperated with ABC in 2011, CASHWAY always considers ABC’ s business as an important system engineering project, and provides all range products series, including CRS, STM, self-service terminals, self-service terminals (self-service card machine), intelligent queuing system, with excellent products and services.</span><span style=";font-family:等线;font-size:16px">&nbsp;</span><span style=";font-family:等线;font-size:16px">With excellent product quality, high-quality service level and excellent brand reputation and CASHWAY won the trust and support of its institutions at all levels. In 2015, CASHWAY fully showed the comprehensive strength, won the high recognition of the agricultural bank of China, successfully won the bid for cash self-service equipment centralized purchasing project once again.</span><span style=";font-family:等线;font-size:16px">&nbsp;</span><span style=";font-family:等线;font-size:16px">For four years, CASHWAY has successively provided a large number of self-service equipment for the agricultural bank of China, layout in the ABC system branch 23 provinces and cities, cash self-service equipment. By the end of 2015, it is expected to reach 15000 units, plus non-cash self-service equipment, the total quality is more than 20000 units. CASHWAY will constantly improve product quality, improve service levels, to ensure the safe and stable operation of the product, serve for ABC to become the world first-class commercial Banks!</span></p><p style="text-indent: 2em;"><span style=";font-family:等线;font-size:14px">&nbsp;</span></p><p style="text-indent: 2em;"><span style=";font-family:等线;font-size:16px">Cashway has been committed to the financial electronic products and services in the field of independent innovation, to become the flagship of China&#39;s banking self-service equipment and services provider. In recent years, CASHWAY has been developing rapidly and remarkable achievements, has become a national brand of ATM industry leading enterprises in China. CASHWAY is located in Tianjin, is facing the coordinated development of Beijing-Tianjin-Hebei, &quot;The Belt and Road &quot; construction, the development of Binhai new area, free trade area construction, national independent innovation demonstration zone construction and other major national strategic superposition of the rare opportunity, at the same time, with many years of technology accumulation and innovation, CASHWAY firstly becomes a domestic advocate and facilitator of the encryption algorithm. CASHWAY, as the only provider of universal coverage cash self-service equipment, non-cash self-service equipment and smart pay password products, serve for five major state-owned banks and nearly 20 provincial rural credit cooperatives, marked CASHWAY national brand in the field of financial self-service equipment in our country has the absolute influence.</span></p><p style="text-indent: 2em;"><span style=";font-family:等线;font-size:14px">&nbsp;</span></p><p style="text-indent: 2em;"><span style=";font-family:等线;font-size:16px">CASHWAY will try to make a management efficiency, product quality, first-class service and brand excellence of industry leading enterprises, to make a greater contribution to the development of China&#39;s financial business!</span></p><p style="text-indent: 2em;"><span style=";font-family:等线;font-size:14px">&nbsp;</span></p><p><br/></p>', '489', '', '77', '1426694400', '150319', '0', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('691', 'Cashway is the top three in the science and technology innovation list! Tianjin Private Enterprises "Healthy Growth Project" Conference Held in Tianjin', '', 'The 9th Tianjin Private Enterprise "Healthy Growth Project" conference was held in Tianjin. The conference was co-hosted by Tianjin Federation of Industry and Commerce, Haihe Media Center, and Tianjin Financial Investment Chamber of Commerce. With its excellent R&D capabilities, cashway was once again shortlisted for the top 100 technological innovation companies and ranked among the top three seats. The company’s party committee secretary and chairman Jiang Haoran took the stage to accept the award on behalf of the company.', '0', '', '', '', '', '', '', '0', '<p style="text-align: justify; text-indent: 2em;"><span style="font-size: 14px;">The 9th Tianjin Private Enterprise &quot;Healthy Growth Project&quot; conference was held in Tianjin. The conference was co-hosted by Tianjin Federation of Industry and Commerce, Haihe Media Center, and Tianjin Financial Investment Chamber of Commerce. With its excellent R&amp;D capabilities, cashway was once again shortlisted for the top 100 technological innovation companies and ranked among the top three seats. The company’s party committee secretary and chairman Jiang Haoran took the stage to accept the award on behalf of the company.</span></p><p style="text-align:center"><span style="font-size: 14px;"><img src="/public/ueditor/upload/image/20201030/1604042023844627.jpg"/></span></p><p style="text-align: justify; text-indent: 2em;"><span style="font-size: 14px;">The &quot;Healthy Growth Project&quot; for private enterprises in Tianjin aims to thoroughly implement the socialist ideology with Chinese characteristics in the new era of Jinping and the spirit of the 19th CPC National Congress, demonstrate the achievements and contributions of Tianjin&#39;s private economy, vigorously promote entrepreneurship, and stimulate the vitality of private enterprises. Promote the high-quality development of the private economy.</span></p><p style="text-align: justify; text-indent: 2em;"><span style="font-size: 14px;">Leaders such as Ji Guoqiang, member of the Standing Committee of the Tianjin Municipal Party Committee and Minister of the United Front Work Department, Li Changjin, Vice Chairman of the All-China Federation of Industry and Commerce, Vice Chairman of the Tianjin Political Consultative Conference, and Chairman of the Municipal Federation of Industry and Commerce attended the meeting and delivered speeches. On behalf of the municipal party committee, Ji Guoqiang first expressed his warm congratulations to the companies on the list. He asked all relevant departments to firmly establish the concept of &quot;industry first, entrepreneurial boss&quot;, continue to optimize the business environment of our city, and respect, equality, and sincerely serve all enterprises. Work. The Municipal Federation of Industry and Commerce should take the &quot;Healthy Growth Project&quot; as the starting point, continuously strengthen ideological and political guidance and policy publicity, close the connection between government and enterprises, create a &quot;home of private economic people&quot;, and jointly promote the high-quality development of our private economy.</span></p><p style="text-align:center"><span style="font-size: 14px;"><img src="http://www.cashwaytech.com/image/news/2020/8/190852047386.jpg"/></span></p><p style="text-align: justify; text-indent: 2em;"><span style="font-size: 14px;">As a listed company on the main board of financial technology in Tianjin, Cashway Technology has always insisted on independent innovation. Its annual R&amp;D investment has been maintained at more than 8% of its operating income. It has gradually applied for patents and has over 1,000 software copyrights. It has mastered many key core technologies. Realize the security and control of the financial self-service field.</span></p><p style="text-align:center"><img src="http://www.cashwaytech.com/image/news/2020/8/190852439399.jpg"/></p><p style="text-align: justify; text-indent: 2em;"><span style="font-size: 14px;"></span><br/></p>', '489', '', '77', '1597766400', '200819', '0', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('690', 'Cashway donated cash disinfection cabinet worth 650,000 RMB to help Hubei Post fight the ', '', 'Hubei bears the brunt of the sudden outbreak of new crown pneumonia. General Secretary Xi Jinping personally directed and deployed, and hundreds of millions of Chinese people have acted, raced against the same time, competed with the disease, united as one to overcome the difficulties together. One party is in trouble and all parties support. On the morning of March 16, Cashway held a cash disinfection cabinet donation ceremony and donated 200 cash disinfection cabinets worth 650,000 yuan to the Hubei branch of China Post Group to help Hubei Post fight the "epidemic".', '0', '', '', '', '', '', '', '0', '<p style="text-align: justify; text-indent: 2em;"><span style="font-size: 16px;">Hubei bears the brunt of the sudden outbreak of new crown pneumonia. General Secretary Xi Jinping personally directed and deployed, and hundreds of millions of Chinese people have acted, raced against the same time, competed with the disease, united as one to overcome the difficulties together. One party is in trouble and all parties support. On the morning of March 16, Cashway held a cash disinfection cabinet donation ceremony and donated 200 cash disinfection cabinets worth 650,000 yuan to the Hubei branch of China Post Group to help Hubei Post fight the &quot;epidemic&quot;.</span></p><p style="text-align:center"><img src="http://www.cashwaytech.com/image/news/2020/3/171109139364.jpg"/></p><p style="text-align: justify; text-indent: 2em;"><span style="font-size: 16px;">At present, the situation of epidemic prevention and control in Hubei and Wuhan is improving, and initial results have been achieved, but the tasks are still arduous and arduous. The more difficult the situation, the more time to act. In order to express high respect to Hubei Post and fully support the normal operation of Hubei Post&#39;s outlets, cashway donated 200 cash disinfection cabinets to Hubei Post. This product can sterilize the cash collected by the outlets and the cash deposited in self-service equipment. Let the people spend &quot;health money&quot; and &quot;rest assured money&quot; to help Hubei Post&#39;s outlets open quickly and quickly restore normal economic and social order.</span></p><p style="text-align: center; text-indent: 2em;"><img src="http://www.cashwaytech.com/image/news/2020/3/171109371595.jpg"/></p><p style="text-align: justify; text-indent: 2em;"><span style="font-size: 16px;">The mountains and rivers are distant and affectionate, and the heart and courage are in the hands and feet. With the outbreak of the epidemic, Hubei Post has always insisted on being on the front line of the fight against the &quot;epidemic&quot;, bravely shouldering heavy burdens, and set off in retrograde, making great contributions to winning the battle against the epidemic and restoring normal social order. Cashway will stand firmly with Hubei Post, fight together, carry it together, and provide solid security and support for Hubei Post, which is on the front line of the epidemic, with faith and perseverance. We will breathe and share destiny, and work together to overcome difficulties and have nothing to do. Fear and move forward courageously. Epidemic prevention and control is about life, and the relationship between resumption of work and production has developed. In the spirit of &quot;fixing the green hills and not relaxing&quot;, cashway actively innovates more products in response to the actual needs of the branches, coordinates the promotion of epidemic prevention and control work and financial service support, and works side by side with bank branches to meet the financial needs of the people. Deepen the bank-enterprise connection, press the &quot;fast forward button&quot; for resumption of work and production, go against the trend, take multiple measures to achieve &quot;two wars equally&quot;, achieve &quot;win-win and win-win&quot;, and contribute to epidemic prevention and control and economic and social development Heng Yin power.</span></p>', '489', '', '77', '1584374400', '200317', '0', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('689', 'Stick to the original aspiration and pursue stability and far-reaching-Cashway holds the 2020 New Year annual meeting', '', 'On January 13, the 2020 Chinese New Year Annual Meeting of Hengyin Financial was held in Tianjin Donglihu Hengda Hotel. The company’s party committee secretary and chairman Jiang Haoran and other directors, supervisors, senior officials, guests and employee representatives gathered together, summing up the past, looking forward to the future, and jointly planning a new chapter in the company’s development.', '0', '', '', '', '', '', '', '0', '<p style="text-indent: 2em;"><title></title></p><blockquote><p style="text-align: justify; text-indent: 2em;"><span style="font-family:arial,helvetica,sans-serif;"><span style="font-size: 16px;">On behalf of the company&#39;s management team, Executive Vice President Zhang Yunfeng delivered a work report entitled &quot;Implementing the Eighteen-Character Policy and Promoting the Company&#39;s High-Quality Development&quot;. A comprehensive summary of the main work in 2019, an in-depth analysis of existing problems, an analysis of the industry development prospects and market competition situation, a clear deployment of business goals and key advancements in 2020, and a yardstick and mirror for the company to promote work and solve problems. Provide specific action guidelines throughout the year.</span></span></p><p style="text-align: center; text-indent: 2em;"><span style="font-family:arial,helvetica,sans-serif;"><img src="/public/ueditor/upload/image/20201030/1604039785291325.jpg"/></span></p><p style="text-align: justify; text-indent: 2em;"><span style="font-family:arial,helvetica,sans-serif;"><span style="font-size: 16px;">The company&amp;rsquo;s party committee secretary and chairman Jiang Haoran delivered a heartening speech. He expressed his heartfelt gratitude to all employees for their dedication over the past year, and warm congratulations to the outstanding team,outstandingemployees and service models. He hopes that everyone will follow the requirements of the target responsibility certificate, focus on the determined tasks and deployment, carefully organize and plan, and nail Enthusiasm, grasping to the end, make every effort to ensure that a satisfactory answer is handed in. He pointed out that 2019 is a very good year for the industry, with explosive growth in demand for self-service equipment and endless new application scenarios. We still have deficiencies in market development, technological innovation, production management, and corporate governance, and we have not grasped development opportunities well. In 2020, standing at the historical intersection of the &quot;two centenary&quot; goals, facing major changes unseen in a century, the &quot;13th Five-Year&quot; plan is concluded and the building of a well-off society in an all-round way is decisive. It is of great significance and arduous tasks. They should have a sense of family and country, stick to their posts, pursue excellence, and strive unremittingly around the most distinctive theme of the times in China today.</span></span></p><p style="text-indent: 2em;">&nbsp;</p><p style="text-indent: 2em;">&nbsp;</p><p style="text-align: center; text-indent: 2em;"><span style="font-family:arial,helvetica,sans-serif;"><img src="/public/ueditor/upload/image/20201030/1604039667861668.jpg"/></span></p><p style="text-align: justify; text-indent: 2em;"><span style="font-family:arial,helvetica,sans-serif;"><span style="font-size: 16px;">The lights are neon flashing, beautiful, singing and dancing, sketches, and recitations in various forms, which are astounding. The party venue has become a glorious and joyful palace. The versatile Hengyin people display their self-demeanor and add beautiful youthful color to the Spring Festival. , To present a shocking visual feast for everyone, everyone gathered here, laughed again and again. On the way forward, wind and rain are normal; in the face of wind and rain, maintaining concentration is the key. The most unforgettable memory of 2019 has been engraved in 2020. The challenges are still severe, and several are fleeting. We will definitely not let go at the end of the year at the beginning of the year, invigorate our spirits, and strengthen our confidence, and we are promoting the company&#39;s gradual development. Through the pass, we will go forward courageously and jointly write a new glorious chapter for the company.</span></span></p><p style="text-align: center; text-indent: 2em;"><span style="font-family:arial,helvetica,sans-serif;"><img src="http://www.cashwaytech.com/image/news/2020/1/151107483292.jpg"/></span></p><p style="text-indent: 2em;">&nbsp;</p></blockquote><p style="text-indent: 2em;">&nbsp;</p>', '489', '', '77', '1578844800', '200113', '0', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('687', 'Face recognition and temperature screening integrated machine', '', '', '0', '', '', '', '', '', '', '0', '', '500', '', '69', '1604034642', '999', '1', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('688', 'Cashway won the "Twenty Years Outstanding Contribution Enterprise Award" in Tianjin Software Industry', '', 'A few days ago, under the guidance of Tianjin Bureau of Industry and Information Technology and hosted by Tianjin Software Industry Association, the "2019 Tianjin Software Industry Development Summit Forum and Tianjin Software Association 20-year Development Seminar" was held in Tianjin. Hengyin Finance won the "Twenty Years Outstanding Contribution Enterprise Award", and the company's party committee secretary and chairman Jiang Haoran won the "Twenty Years Outstanding Contribution Person Award".', '0', '', '', '', '', '', '', '0', '<p dir="ltr"><br/></p><p dir="ltr" style="text-align: justify; text-indent: 2em;"><title></title></p><p dir="ltr" style="text-align: justify; text-indent: 2em;"><span style="font-size: 16px;">A few days ago, under the guidance of Tianjin Bureau of Industry and Information Technology and hosted&nbsp;by Tianjin Software Industry Association, the &quot;2019 Tianjin Software Industry Development Summit Forum and Tianjin Software Association 20-year Development Seminar&quot; was held in Tianjin. Hengyin Finance won the &quot;Twenty Years Outstanding Contribution Enterprise Award&quot; and the company&#39;s party committee secretary and chairman Jiang Haoran won the &quot;Twenty Years Outstanding Contribution Person Award&quot;.</span></p><p dir="ltr" style="text-align: justify; text-indent: 2em;"><span style="font-size: 16px;">With cloud computing, Internet of Things, big data, artificial intelligence, blockchain and other new-generation information technologies accelerating to penetrate into various fields of economy and social life, the software industry&#39;s service-oriented, platform-oriented, and integrated trend has become more obvious. Tianjin Software Industry Association closely follows the industry development trend, pays attention to the needs of enterprises, adheres to the service-oriented principle, and contributes positively to the development of Tianjin&#39;s software and information technology service industry.</span></p><p dir="ltr" style="text-align: justify; text-indent: 2em;"><span style="font-size: 16px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p style="text-align: center; text-indent: 2em;"><img height="330" src="http://www.cashwaytech.com/image/news/2019/12/230917410039.jpg" style="width: 507px; height: 330px;" width="507"/></p><p dir="ltr" style="text-align: justify; text-indent: 2em;"><span style="font-size: 16px;">As a leading domestic smart banking solution provider, Cashway is the vice chairman unit of the fourth council of Tianjin Software Industry Association. The company always attaches great importance to software development and application and insists on independent innovation. The software products used in financial self-service equipment are all independently designed and developed, enjoying independent intellectual property rights, adopting mature software architecture, achieving independent and controllable technology, and software products have become serialized , Diversified, well met the needs of banking financial solutions, software research and development results have been increasing year by year, and the market share has been consolidated and expanded.</span></p><p dir="ltr" style="text-align: justify; text-indent: 2em;"><span style="font-size: 16px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><img height="238" src="http://www.cashwaytech.com/image/news/2019/12/230917548613.jpg" style="width: 353px; height: 238px;" width="353"/><span style="font-size: 16px;">&nbsp;</span><img height="238" src="http://www.cashwaytech.com/image/news/2019/12/230918213141.jpg" style="width: 356px; height: 238px;" width="356"/></p><p dir="ltr" style="text-align: justify; text-indent: 2em;"><span style="font-size: 16px;">In the face of new opportunities and challenges in the industry, Hengyin Financial has vigorously promoted the transformation from a hardware provider to an integrated service provider, from mainly doing banking equipment to providing smart devices and solutions for various financial-related fields. Actively embrace new technology, continue to increase investment in software research and development, maintain professionalism in existing fields, improve software service capabilities, and extend the experience of technology application in the financial field to more fields such as transportation, government, and medical care, and strive to create characteristics Systems, special equipment, and special solutions continue to enhance core competitiveness, further consolidate and enhance the industry&#39;s leading position, and provide important support for the company&#39;s business to develop faster and better.</span></p><p dir="ltr" style="text-align: justify; text-indent: 2em;"><span style="font-size: 16px;">&nbsp;</span></p>', '489', '', '77', '1577030400', '191223', '0', '1', '', '', '0', '');
INSERT INTO `tp_archives` VALUES ('622', '测试', '', '', '0', '', '', '', '', '', '', '0', '<div id="ali-anchor-AliPostDhMb-1ri66" class="mceSectionContainer" style="padding-top: 8px;" data-section="AliPostDhMb-1ri66" data-section-title="Product Description"><div id="ali-title-AliPostDhMb-1ri66" style="padding: 8px 0; border-bottom: 1px solid #ddd;"><span style="background-color: #ddd; color: #333; font-weight: bold; padding: 8px 10px; line-height: 12px;">Product Description</span></div><div style="padding: 10px 0;"><p><span style="font-size: 16px;"><strong>&nbsp;55/65/75/86 inch LCD tv interactive touch panel smart board for meeting room</strong></span></p><a href="https://message.alibaba.com/msgsend/contact.htm?spm=a2700.details.cordpanyb.dmessage.438317falzVt8f&action=contact_action&domain=1&id=1600101568006&id_f=IDX1dKsBBg3MKE1gXwDuV4aGDVLWlt7sfQk5EUroT5Kb3cfJi1wnHfDEGX7SFavzJaka&mloca=main_en_detail&tracelog=tracedetailfeedback&umidToken=B048a8c725713588588e4ce3e7d2b2874" target="_blank" rel="noopener noreferrer"><img src="//sc01.alicdn.com/kf/He1ab7f9d39424040af874fbafea1815eW/240515522/He1ab7f9d39424040af874fbafea1815eW.jpg" alt="_01" width="750" height="1083" ori-width="790" ori-height="1141"/><img src="//sc02.alicdn.com/kf/Hfcbacb25a36e4135a7722a9f8658e8c2T/240515522/Hfcbacb25a36e4135a7722a9f8658e8c2T.jpg" alt="_02" width="750" height="1661" ori-width="790" ori-height="1750"/></a><table style="border-collapse: collapse; border: none; height: 526px;" border="1" width="748" cellspacing="0"><tbody><tr class="firstRow"><td style="width: 198.958px; padding: 0pt 5.4pt; border: 1pt solid windowtext;" valign="top"><p style="margin-bottom: 0.0000pt;"><strong><span style="font-family: Calibri; font-size: 11.0000pt;">Display dimension</span></strong></p></td><td style="width: 516.736px; padding: 0pt 5.4pt; border-left: none; border-right: 1pt solid windowtext; border-top: 1pt solid windowtext; border-bottom: 1pt solid windowtext;" valign="top"><p style="margin-bottom: 0