INSERT INTO `tp_archives` VALUES ('669', 'Smart Locker  CASH35AG-1239', '', 'Under the background of branch transformation and convenience, the smart locker aims at reforming branch operation and management. The introduction of“smart locker” in branch can realize the centralized storage and management of operation elements, such as branch receipts and important items with the method of centralization & sharing.', '0', '', '', '', '', '', '', '0', '<table cellspacing="0" cellpadding="0"><tbody><tr class="firstRow" style="height: 232px;"><td width="936" height="232" valign="top" style="padding: 0px 7px; word-break: break-all;" colspan="2"><p><span style="font-size: 16px;"><strong><span style="color: black;" font-size:="">Description:</span></strong></span></p><p><span style="color: black; font-size: 16px;">&nbsp;</span></p><p><span style="color: black; font-size: 16px;">&nbsp;</span></p><p><span style="font-size: 16px;">Under the background of branch transformation &nbsp; and convenience, the smart locker aims at reforming branch operation and management. &nbsp; The introduction of</span><span style="font-size: 16px;">“smart locker” in branch can realize the centralized &nbsp; storage and management of operation elements, such as branch receipts and &nbsp; important items with the method of centralization &amp; sharing.</span></p></td></tr><tr><td width="433" valign="top" style="padding: 0px 7px; -ms-word-break: break-all;"><p><span style="font-size: 16px;"><strong><span style="font-size: 16px; color: black;" font-size:="">Feature:</span></strong></span></p><p><span style="color: black; font-size: 16px;">&nbsp;</span></p><p><span style="color: black; font-size: 16px;">&nbsp;</span></p><p><span style="color: black; font-size: 16px;">Replacing the traditional way of &nbsp; physical handover, it breaks the bottleneck between person and physical &nbsp; objects<span style="color: black; font-family: Arial, sans-serif; font-size: 16px;">.</span></span></p><p><span style="color: black; font-size: 16px;">&nbsp;</span></p><p><span style="color: black; font-size: 16px;">The smart locker adopts cold &nbsp; rolling steel plate technology, which is healthy, safe and environmental &nbsp; protection<span style="color: black; font-family: Arial, sans-serif; font-size: 16px;">.</span></span></p><p><span style="color: black; font-size: 16px;">&nbsp;</span></p><p><span style="color: black; font-size: 16px;">Each lock of the cabinet door is &nbsp; controlled by the system, different locks with anti-theft design do not &nbsp; interfere with each other<span style="color: black; font-family: Arial, sans-serif; font-size: 16px;">.</span></span></p><p><span style="color: black; font-size: 16px;">&nbsp;</span></p><p><span style="color: black; font-size: 16px;">It is suitable for the lobby and &nbsp; through-the-wall installation in the branch, meeting the requirements of &nbsp; industry security.</span></p><p><span style="color: black; font-size: 16px;">&nbsp;</span></p></td><td width="573" valign="top" style="padding: 0px 7px; -ms-word-break: break-all;"><p><img title="1587029249552743.png" style="float: right;" alt="11 智能储物柜 (1).png" src="/public/ueditor/upload/image/20200416/1587029249552743.png"/></p></td></tr><tr><td width="936" valign="top" style="padding: 0px 7px; -ms-word-break: break-all;" colspan="2"><p><span style="font-size: 16px;"><strong><span style="font-size: 16px; color: black;" font-size:="">Specification</span></strong></span></p><p><span style="font-size: 16px;"><strong><span style="font-size: 16px; color: black;" font-size:="">&nbsp;</span></strong></span></p><p><span style="font-size: 16px;"><strong>Controlling Unit</strong></span></p><p><span style="font-size: 16px;">CPU: &nbsp; Intel I5, RAM: 4G,1TB DDR, support ethernet interface support TCP/IP</span></p><p><span style="font-size: 16px;"><strong>&nbsp;</strong></span></p><p><span style="font-size: 16px;"><strong>Display</strong></span></p><p><span style="font-size: 16px;">15&quot; &nbsp; LCD touchcreen display, explosion-proof, privacy display, filter, revolution: &nbsp; 1024*768</span></p><p><span style="font-size: 16px;"><strong>&nbsp;</strong></span></p><p><span style="font-size: 16px;"><strong>ID Card Reader</strong></span></p><p><span style="font-size: 16px;"><strong>&nbsp;</strong></span></p><p><span style="font-size: 16px;"><strong>Keyboard</strong></span></p><p><span style="font-size: 16px;">4 &nbsp; X 4 numeric metal keypad, waterproof, dust-proof, PCI4.0 certified EPP</span></p><p><span style="font-size: 16px;"><strong>&nbsp;</strong></span></p><p><span style="font-size: 16px;"><strong>Finger Printer</strong></span></p><p><span style="font-size: 16px;">Sensor &nbsp; type: CMOS, matching method: 1:1 or 1:N, interface: USB2.0</span></p><p><span style="font-size: 16px;"><strong>&nbsp;</strong></span></p><p><span style="font-size: 16px;"><strong>Camera(Portrait)</strong></span></p><p><span style="font-size: 16px;">Portrait &nbsp; camera</span></p><p><span style="font-size: 16px;"><strong>&nbsp;</strong></span></p><p><span style="font-size: 16px;"><strong>Human Proximity &nbsp; Sensor</strong></span></p><p><span style="font-size: 16px;">Detecting &nbsp; distance: 0-100cm, sensor type: IR</span></p><p><span style="font-size: 16px;"><strong>&nbsp;</strong></span></p><p><span style="font-size: 16px;"><strong>LED Light</strong></span></p><p><span style="font-size: 16px;"><strong>&nbsp;</strong></span></p><p><span style="font-size: 16px;"><strong>Electromagnetic &nbsp; Pressure Sensing Pen</strong></span></p><p><span style="font-size: 16px;"><strong>&nbsp;</strong></span></p><p><span style="font-size: 16px;"><strong>Barcode Reader</strong></span></p><p><span style="font-size: 16px;">Support &nbsp; 1D &amp;2D barcode</span></p><p><span style="font-size: 16px;"><strong>&nbsp;</strong></span></p><p><span style="font-size: 16px;"><strong>Body</strong></span></p><p><span style="font-size: 16px;">Explosion-proof, &nbsp; intelligent system control</span></p><p><span style="font-size: 16px;"><strong>&nbsp;</strong></span></p><p><span style="font-size: 16px;"><strong>Handset</strong></span></p><p><span style="font-size: 16px;">Handset, &nbsp; explosion-proof</span></p><p><span style="font-size: 16px;"><strong>&nbsp;</strong></span></p><p><span style="font-size: 16px;"><strong>Card Reader</strong></span></p><p><span style="font-size: 16px;">Motorized &nbsp; card reader, EMV 4.0 Level 1 compliant, support IC card R/W</span></p><p><span style="font-size: 16px;"><strong>&nbsp;</strong></span></p><p><span style="font-size: 16px;"><strong>Working Environment</strong></span></p><p><span style="font-size: 16px;">Temperature: &nbsp; +5°C to +40°C</span></p><p><span style="font-size: 16px;">Relative &nbsp; humidity: 5% - 95%</span></p><p><span style="font-size: 16px;"><strong>&nbsp;</strong></span></p><p><span style="font-size: 16px;"><strong>Dimensions</strong></span></p><p><span style="font-size: 16px;">H*W*D: &nbsp; 1700mm * 600mm * 400mm</span></p><p><span style="font-size: 16px;"><strong>&nbsp;</strong></span></p><p><span style="font-size: 16px;"><strong>Power Supply</strong></span></p><p><span style="font-size: 16px;">AC220V±15%&nbsp; 50Hz±1Hz</span></p><p><span style="font-size: 16px;">AC110V±15%&nbsp; 60Hz±1Hz</span></p><p><span style="font-size: 16px;"><br/></span></p><p><span style="font-size: 16px;">&nbsp;* The specific configuration is subject to the actual product</span></p></td></tr></tbody></table><p><br/></p>', '498', '', '66', '1601191853', '999', '0', '1', '', '', '0', '');
