INSERT INTO `tp_archives` VALUES ('696', 'Tianjin's first 24-hour visual self-service teller machine unveiled in the service hall', '', '', '0', '', '', '', '', '', '', '0', '<p><span style="font-size: 16px;">Today is the first day of heating this winter. The city’s first 24-hour visualized self-service heating service hall was unveiled in the Fengnian Village Service Hall of Tianjin Energy Group Thermal Power Company. All 23 heating service items including heating repair, heating payment, and application for reheating were implemented 24 hours self-service. If you encounter problems during the process, you can also connect with the customer service staff through video connection at any time to get help &quot;face to face&quot;.</span></p><p><span style="font-size: 16px;"><img src="data:image/png;base64,"/><img src="data:image/png;base64,"/></span></p>', '489', '', '77', '1605715200', '20201119', '0', '1', '', '', '0', '');
