INSERT INTO `tp_cate` VALUES ('390', 'CASHWAY In The World', 'Information technologies shorten the world distance, expand people’s horizon; With more intelligent technologies, CASHWAY makes universally beneficial, empowers the future.', '', '', '', 'As a professional financial self-service equipment provider, CASHWAY offers a wide products portfolio with competitive price and high quality for your choice. Our main business scope covers the Mid-East, Africa and South America, and the market share is increasing year by year.', '', '0', '1', '1', '', '20200522\b1273907cb76fc560c96c0a1f790e497.png', '1', 'list_article.htm', 'article_article.htm', 'index_article.htm', '1', '999', '', '74', '385', '0', 'fa-th-list', '');
INSERT INTO `tp_cate` VALUES ('485', 'Technical support', '', '', '', '', '', '<p style="text-align: left; text-indent: 2em;" dir="ltr"><span style="font-size: 18px;">As a leading provider of cash processing technology and high-quality technical solutions, CASHWAY is committed to providing our customers and partners with world-class support&nbsp;with72 hour , fast response services, and customized solutions for optimized operations.</span></p><p style="text-align: left; text-indent: 2em;" dir="ltr"><span style="font-size: 18px;">&nbsp;</span></p><p style="text-align: left; text-indent: 2em;" dir="ltr"><strong><span style="font-size: 18px;">Software-engineering service</span></strong></p><p style="text-align: left; text-indent: 2em;" dir="ltr"><span style="font-size: 18px;">CASHWAY has many years of experience in software engineering services. Our experienced professional software staff will provide you with accurate customized software services at any time, covering multi-vendor terminal software, monitoring software, and providing software engineering services including software customization, function development,&nbsp;and systems Integration and software upgrades and version management.</span></p><p style="text-align: left; text-indent: 2em;" dir="ltr"><span style="font-size: 18px;">&nbsp;</span></p><p style="text-align: left; text-indent: 2em;" dir="ltr"><strong><span style="font-size: 18px;">Customer support services</span></strong></p><p style="text-align: left; text-indent: 2em;" dir="ltr"><span style="font-size: 18px;">In order to help you develop your business, our dedicated customer support team is committed to providing you with world-class remote or on-site customer support solutions, including hardware and software support, technical consulting, troubleshooting, first / second-line maintenance, preventive maintenance, random inspection, report analysis services, etc.</span></p><p style="text-align: left; text-indent: 2em;" dir="ltr"><span style="font-size: 18px;">&nbsp;</span></p><p style="text-align: left; text-indent: 2em;" dir="ltr"><strong><span style="font-size: 18px;">Spare parts Service</span></strong></p><p style="text-align: left; text-indent: 2em;" dir="ltr"><span style="font-size: 18px;">We know that even the smallest part can stop the whole system. Therefore, we have established spare parts service to provide you with the best spare parts supply.</span></p><p style="text-align: left; text-indent: 2em;" dir="ltr"><span style="font-size: 18px;">&nbsp;</span></p><p style="text-align: left; text-indent: 2em;" dir="ltr"><strong><span style="font-size: 18px;">Knowledge service</span></strong></p><p style="text-align: left; text-indent: 2em;" dir="ltr"><span style="font-size: 18px;">To keep you up to date with the latest developments in the industry and simplify operations, our knowledge services cover a wide range of technical and management training, customized training courses, practice oriented seminars, document services, consulting and online learning opportunities.</span></p><p style="text-align: justify; text-indent: 2em;" dir="ltr"><span style="font-size: 18px;">&nbsp;</span></p>', '0', '1', '1', '', '', '2', 'list_article.htm', 'article_article.htm', 'index_article.htm', '1', '999', '', '69', '382', '0', 'fa-th-list', '');
