INSERT INTO `tp_cate` VALUES ('482', 'Company milestone', '', '', '', '', '', '<p style="text-align:center"><span style="font-family: 黑体, SimHei; font-size: 24px;"></span></p><p style="margin-top:4px;margin-right:0;margin-bottom:4px;margin-left:0;text-align:center"><span style="font-size: 24px;"><strong><span style="font-family: 宋体;">2004-2019 CASHWAY Development Milestone</span></strong></span></p><p style="margin-top:4px;margin-right:0;margin-bottom:4px;margin-left: 0"><span style="color: black; font-size: 24px;">&nbsp;</span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph;font-variant-ligatures: normal;font-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;word-spacing:0px"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; color: black; background: white;">2004&nbsp;</span></strong><strong><span style="font-size: 19px; font-family: 宋体;">CASHWAY was established, and its main business covers&nbsp;systems integration and telecom value-added services;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-family: " microsoft="" color:="" font-size:="">&nbsp;</span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph;font-variant-ligatures: normal;font-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;word-spacing:0px"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; color: black; background: white;">2008 The first self-developed and manufactured ATM was successfully produced at CASHWAY; In the same year, the first POSATM was shipped to Africa,started to enter oversea market;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph;font-variant-ligatures: normal;font-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;word-spacing:0px"><span style="font-family: " microsoft="" color:="" font-size:="">&nbsp;</span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph;font-variant-ligatures: normal;font-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;word-spacing:0px"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; color: black; background: white;">2009 On 17th,Feb.CASHWAY Financial Technical Park laid a foundation; Self-service equipments took the first step towards ABC BANK and leap towards a new stage of business in China;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph;font-variant-ligatures: normal;font-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;word-spacing:0px"><span style="font-family: " microsoft="" color:="" font-size:="">&nbsp;</span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph;font-variant-ligatures: normal;font-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;word-spacing:0px"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; color: black; background: white;">2010 100 mu CASHWAY Financial Technical Park was fully put into use; The capacity of cash machine-ATM/CRS reached 50000 units; non-cash machine-self-service equipments to 100000 units;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; background: white;">&nbsp;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; color: black; background: white;">2011 100 units CRS took the first step towards ABC BANK, and 500 units at ABC bank in Hebei province;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; background: white;">&nbsp;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; color: black; background: white;">2012 ATM took the first step towards ABC BANK In China;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; background: white;">&nbsp;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; color: black; background: white;">2013 Self-developed Cash Dispenser successfully passed the national acceptance;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; background: white;">&nbsp;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; color: black; background: white;">2014 Introduction of strategic investors,registered capital increased to RMB 200 million;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; background: white;">&nbsp;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; color: black; background: white;">2015 The 50,000th ATM off the assembly line;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; background: white;">&nbsp;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; color: black; background: white;">2016 The TOP 3 ATM provider in the domestic market;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; background: white;">&nbsp;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; color: black; background: white;">2017 Listed in Shanghai Stock Exchange (S.C:603106);</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; background: white;">&nbsp;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; color: black; background: white;">2018 The TOP2 ATM provider in the domestic market;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; background: white;">&nbsp;</span></strong></span></p><p class="MsoListParagraph" style="margin-top:4px;margin-right:0;margin-bottom: 4px;margin-left:22px;text-align:justify;text-justify:inter-ideograph"><span style="font-size: 24px;"><strong><span style="font-size: 19px; font-family: 宋体; color: black; background: white;">2019 The TOP1 ATM provider in the domestic market.</span></strong></span></p><p style="text-align: center;"><br/></p>', '0', '1', '1', '', '', '1', 'list_article.htm', 'article_article.htm', 'index_article.htm', '1', '999', '', '81', '383', '0', 'fa-th-list', '');
